import React, { FC } from "react";
import styled from "styled-components";

const Container = styled.div`
  ${props => props.theme.whiteBox};
  position: absolute;
  top: 35px;
  left: 0;
  width: 240px;
  height: 300px;
  z-index: 100;
`;

interface Props {
  userId: string;
}

const HoverUser: FC = ({ userId }) => {
  return <Container></Container>;
};

export default HoverUser;
